import React from "react";
import pic_1 from "../src/images/Group 1321314748.png";
import Main from "./Main";

const About = () =>{
    return(
        <>
        <Main 
        title="Welcome to About" 
        para= "we are team of talented Developers making Websites"
        btn="Get Start"
        imgsrc={pic_1}
        />

        </>
    )
}

export default About;
